Last night I had the opportunity to help facilitate the first of @amphibianstage’s Under 40 Community Night. After the past couple years, it feels realllly easy to get stuck in a routine of hanging at home and scrolling in bed. Amphibian Stage is here and ready to help us branch out! Live theater gives us an opportunity to connect with ourselves, and others in ways we may have been missing lately. Plus, after the show, we headed over to @thehollyftw for a drink together.

I’m really excited for these nights to roll out. I really do think you’ll love them! So, if you’re new in town, looking for your circle, or just wanting to meet some new friends - keep your eyes on what @amphibianstage is doing. Give them a follow to keep up.

