While in Chicago, I hit a bucket-list landmark of dark tourism. We visited the site of H.H. Holmes’ “Murder Castle.” H.H. Holmes. (Herman Webster Mudgett) was one one of the most prolific murders in American history, claiming to have killed around 200 people on this plot in a hotel custom-designed for brutality. He actually began the process of building another, almost identical “murder castle” in Fort Worth, after he conned (and of course subsequently killed) two Fort Worth women out of a significant plot of land. Fort Worth police even helped in his eventual arrest, signing a warrant for a stolen horse. Had he been able to follow through with his plans, it would have undoubtedly altered Fort Worth’s history. His Chicago hotel burned down in 1895, widely accepted to be a result of arson. In 1938, it was demolished and is now a post office.

He was a horrific figure in history and although not a terribly exciting building, it was powerful to visit the site of where so many of his atrocities took place.

// when visiting any dark history landmark, it’s important to make sure you take a moment of silence, prayer, meditation, etc. and acknowledge the victims. You can be interested in dark tourism and true crime while still respecting those who lost their lives.

